import React from 'react';
import { useForm } from 'react-hook-form';
import {
  Box,
  Button,
  FormControl,
  FormLabel,
  Input,
  Select,
  VStack,
  useToast,
} from '@chakra-ui/react';
import { TicketFormData } from '../types/ticket';
import { createTicket } from '../api/ticketApi';

const TicketForm: React.FC = () => {
  const { register, handleSubmit, reset, formState: { errors } } = useForm<TicketFormData>();
  const toast = useToast();

  const onSubmit = async (data: TicketFormData) => {
    try {
      await createTicket(data);
      toast({
        title: 'Ticket created.',
        description: 'The ticket has been successfully created.',
        status: 'success',
        duration: 3000,
        isClosable: true,
      });
      reset();
    } catch (error) {
      toast({
        title: 'Error',
        description: 'Failed to create ticket.',
        status: 'error',
        duration: 3000,
        isClosable: true,
      });
    }
  };

  return (
    <Box as="form" onSubmit={handleSubmit(onSubmit)} p={4}>
      <VStack spacing={4} align="stretch">
        <FormControl isRequired>
          <FormLabel>Trip ID</FormLabel>
          <Input {...register('tripId', { required: true })} />
        </FormControl>

        <FormControl isRequired>
          <FormLabel>Trip Date</FormLabel>
          <Input type="date" {...register('tripDate', { required: true })} />
        </FormControl>

        <FormControl isRequired>
          <FormLabel>Driver ID</FormLabel>
          <Input type="number" {...register('driverId', { required: true })} />
        </FormControl>

        <FormControl isRequired>
          <FormLabel>Reason</FormLabel>
          <Select {...register('reason', { required: true })}>
            <option value="Harassment">Harassment</option>
            <option value="Drop">Drop</option>
            <option value="Bad behavior">Bad behavior</option>
            <option value="Took extra money">Took extra money</option>
          </Select>
        </FormControl>

        <FormControl isRequired>
          <FormLabel>City</FormLabel>
          <Select {...register('city', { required: true })}>
            <option value="Baghdad">Baghdad</option>
            <option value="Basra">Basra</option>
            <option value="Karbala">Karbala</option>
          </Select>
        </FormControl>

        <FormControl isRequired>
          <FormLabel>Service Type</FormLabel>
          <Select {...register('serviceType', { required: true })}>
            <option value="Eco">Eco</option>
            <option value="Plus">Plus</option>
          </Select>
        </FormControl>

        <FormControl isRequired>
          <FormLabel>Customer Phone</FormLabel>
          <Input type="tel" {...register('customerPhone', { required: true })} />
        </FormControl>

        <FormControl isRequired>
          <FormLabel>Agent Name</FormLabel>
          <Select {...register('agentName', { required: true })}>
            <option value="Ahmed">Ahmed</option>
            <option value="Jack">Jack</option>
          </Select>
        </FormControl>

        <Button type="submit" colorScheme="blue">
          Create Ticket
        </Button>
      </VStack>
    </Box>
  );
};

export default TicketForm;
